i tiek pieteiktmūžigas šahs - 6. ... Ka6 7.Zb8',0,'2009-10-24 16:13:38','2009-10-24 16:13:38',22,NULL,NULL,'','',NULL,''),(98912,'',NULL,'2S2K1Sp4p23pk37bB4P1p3Qp2Q','#3','','1.Ke8! ~ 2.Ld7#, 1...f5+ 2.Kf8 d5 3.Da6#, 1...f6+ 2Kd8 f5 3.Dd6#. Ievadgājien karalis iet uz lauciņa, kur tam var melnie pieteikt šahu',0,'2009-10-24 16:13:38','2009-10-24 16:13:38',22,NULL,NULL,'','',NULL,''),(98913,'',NULL,'5K284p34k1P185s','Neizšķirts','','Etīde mazulīte 1.g6! Zg5 2.g7Zh7+ 3.Kf7 Zf6 4.Kg6! Zg8+ 5.Kf7 (5.Kh7? Ze7!) Zh6+6.Kg6 Zg8+ 7.Kf7 Zh6+ 8.Kg6 Zf5 9.g8Z!\nParadoskali - melnajiem pēc 4.Kg6! nekas netiek draudēts, tomēr, neskaitot gājienu\natkārtošanos, tiem nav arī citu iespeju.',0,'2009-10-24 16:13:39','2009-10-24 16:13:39',22,NULL,NULL,'','',NULL,''),(98914,'',NULL,'B4s22BpP3R2Kps2RP2P3pk6b1pQ4Pp1r7r3b','s#2','','1...Zd5/Ld5 2.Dc4/Dxc3+Kxc4/Kxc3#.\n1.Tc6!~2.Dd4+ Txd4#, 1...Zd5 2.Dxc3\nZxc3#, 1...Ld5 2.Dc4 Lxc4#.',0,'2009-10-24 16:13:39','2009-10-24 16:13:39',22,NULL,NULL,'','',NULL,''),(98915,'',NULL,'83K1P26p12Sk2P12rB41Q63PS','s#10','','1.Zb7! Ke4 2.Zd6+Kd5 3.Ke7 Kc6 4.Db6+ kd5 5.Db7+ Lg7 Kc5 7.d4 Kd5 8.Kf6 Kxd6\n9.De7+ Kxd5 10.De6+ Txe6#.',0,'2009-10-24 16:13:39','2009-10-24 16:13:39',22,NULL,NULL,'','',NULL,''),(98916,'',NULL,'5b2Q72p3p12R3S13k41s2S32P2K7b','#2','','1.Zxc5 2.Da1#, 1...Lxc5 2.Dg7#. 1.Db8!~\n2.De5#, 1...Zxc5 2.Db2#, 1...Kxc5 2.Ze6#.\nAr savu pirmo gājienu baltie atstāj bez aizsardzibas vienu no savam spēcigakajam figuriam, kuru, salīdziot or iluzoro spēli, nu jau sit 3 melnas figuras, veidojot dažadus matus.\n',0,'2009-10-24 16:13:39','2009-10-24 16:13:39',22,NULL,NULL,'','',NULL,''),(98917,'',NULL,'84K33P45S2B2P1Qp1B1kP1sp11pP3P2R','#2','','1.Zxg3? Zg1! 1.De3? Zd2! 1.d5? Zd4!\n1.Dc1! bc1 2.Lb4#, 1...Zd2.\n2.Dxb2#, 1...Zg1 2.De1#',0,'2009-10-24 16:13:39','2009-10-24 16:13:39',22,NULL,NULL,'','',NULL,''),(98918,'',NULL,'81p4p11R683K1k286R','#3','','1...Kf3 2.Tbb2 ~ 3Tbf2#, 1...Kf5 2.Txg7\nKf4 3.Tf6. 1.Tbg6! Kf3 2.Ke5 ~ 3.T6g3#,\n1...Kf6 2.Ke3 ~ 3.T2g5#.\