ēmu grupai reversīvajām tēmam.',0,'2009-10-24 16:13:47','2009-10-24 16:13:47',22,NULL,NULL,'','1 prize',NULL,'Probleemblad, 1958'),(98983,'',NULL,'B2sR32p1b2S2rS3R2rPk32p3P1Q1P2P28K1B5','#2','','В иллюзорной игре варианты с темой Флориана 1...R5~ 2. Rh5x, 1...Rxd5 2.f4x and 1...R6~ 2.f4x, 1...Rxd62. Rh5x. В решении маты на эти ходы меняются: 1.Sf6 ZZ, 1...R5~ 2.f4x, 1...Rxd5 2.Sd7x and 1...R6~ 2.Sd7x, 1...Rxd6 2.f4x. 1...S~, Kxd6 2.Sf7, Bf4x',0,'2009-10-24 16:13:47','2009-10-24 16:13:47',22,NULL,NULL,'','',NULL,'FIDE album 1945-1955'),(98984,'',NULL,'1b2q32s2Rp1p1p1k1S1PpB53P41S3Q1bB1sP6K','#2','','В глваном варианте этой задачи-шутки дава белых\r\nи один чёрный конь делают ходы в разные углы\r\nдоски:\r\n\r\n1.Kh8 Ka8 2.ka1X! \r\nУгроза - 2.Фе4Х. 1...Kd5, Ф:f7, Cg2\r\n2. Ф:h3, Ф:f7, Фf5X. ',0,'2009-10-24 16:13:47','2009-11-25 13:09:17',NULL,'','Qe8 Bb8','X большой крестик','',NULL,'\"Padomju Jaunatne\" 1954'),(98985,'',NULL,'2RQ45P2S2p3br2k1P2q4p21s1P4p3S1b1B3K','#2','','1.Dd7? Zd4! 1.De7? Zc5! 1.Df6? De4!\n1.De8! ~\'2. De6#, 1...Zd4 2.Zc3# 1...Zc5 Zc7#, 1...De4 2.Dc6#. Metu maiņa pēc melno gājieniem amldinājumos un risinājumā.',0,'2009-10-24 16:13:47','2009-10-24 16:13:47',22,NULL,NULL,'','',NULL,'MK 1968'),(98986,'',NULL,'K6b3p3rQ3S4s1kp1s2R2S2pppp2R1p2qp45B','#2','','Odesas tēma realizēta tikai tematiskos maldinājumos, bet risinajuma visi tematiskie mati atkārtojas variantos 1.Te3? ~ 2.Lc4#/ Txb5# 1...de6 Dxb5#. 1...Zxe6 2.Db7#, bet 1...Dd3!\n1.Tf6? ~ 2.Dxb5# / Db7# 1...Zxe4 2.Lc4#, 1...Dxe4 2.Txb5#, bet 1...Zd4! Risina Tf5! ~ 2.Zf4#, 1...de6 2.Dxb5# 1...Zxe6 2.Db7#, 1...Zxe4 2.Lc4#, 1...Dxe4 2.Txb5#.',0,'2009-10-24 16:13:47','2009-10-24 16:13:47',22,NULL,NULL,'В начале задачи очепятка. То ли Косая, но с пропущённым пробелом, то ли вопросительный знак... С пропуском шифта.\n\n1.Te3? ~ 2.Lc4#/','',NULL,'Dienvildslvijas Solidarittes konkurss. 1972'),(98987,'',NULL,'83Rpq1p4s2S1p61P1s1P21p1k1p21K1P1B23R2S1','#2','','1..Kc4 2.Bxd4x, 1...Ke4 2.d3x\n1.Dxe7 Kc4 2.d3x, 1...Ke4 2.Bxd4x\nЧередование матов на ходы черного короля в иллюзорной игре. Эта идея разработана в форме блока',0,'2009-10-24 16:13:47','2009-10-24 16:13:47',22,NULL,NULL,'','3 почетный отзыв',NULL,'Magyar Sakkelet, 1957'),(98988,'',NULL,'83p41p1Ppp21pSk1b1R1p1P1B21R1S4B1Q3P11K6','#2','','Готовы варианты на ходы черного короля: 1...Kc6 2.Kxb4x, 1...Kxd4 2.Rxb4x. В решении 1.Sxe6 ZZ, эти маты следуют на другие ходы короля (перемена защит): 1...Kxe4 2.Sxb4x, 1...Kxe6 2.Rxb4x. В тематических попытках 1.Sxb4x? Kxd4! (нет мата 2.Rxb4) и 1.Rxb4x? Kc6! (нет мата 2.Sxb4) осуществлена тема обструкции белых фигур',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','',NULL,'Tridskrift for schach, 1959'),(98989,'',NULL,'2K2S2222221p221p2p1p2s2k1Pb1Q3R2p7Bb5R','#3','','Balto figūru pakāpeniska izlēgšana,melniem aizsargājoties maldinājumos: 1.Ze6? ~ 2.Te3#, 1...Zd3 2.Thh3 ~ 3.Te3#, 1...Zd5 2.Te1+ ~ 3.Zxg5#. Bet visu izjauc 1...Ld3 (izslēdz Db3 pa horizontali) 2.Thh3? Lc4! (izslēdz Db3 pa diagonali) 1...Zh7? (~ 2.Zf6#) Ld3 2.Thh3 ~ 3.Zf6#, 1...Zd5, 2.Te1 + Lxe1 3.Zxg5#. Bet 1...Zd3 (izslēdz Db3)2.Thh3? Zb2! (Izsledz La1) Tāpēc vispirms 1. Thh3! ~ 2. Tf4+... 1...Zd3\n2.Zae6 3.Te3#, 1...Ld3 2.Zh7 3.Zf6#.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','',NULL,'Mačs \"Latvija- Lietuva -leņingrada\" 1977'),(98990,'',NULL,'4RR1B1q5B1S62ppppPpr3Pk1Pp5p14Pr2Ks1s1S1Q','#3','','Белые ладьи и слоны, расположение которых в начальной позиции напоминает лойдовскую \"игру на органе\", образуют попарно в вариантах батареи, а на матирующем ходу выключают черного ферзя по седьмой горизонтали. 1.Dg1 ~ 2.Dxg3x, 1...Rg2 2.Bxf5 (вторая угроза) 2...Rxe4 3.Bd7x, 1....Rxe2 2.Rxf5x Ke4 3.Rf7x, 1...Rxf1 2.Bxe5x Kxe4 3.Bc7x, 1...Kxe4 2.Rxe5x Kd4 3.Re7x',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','MK 1961, 1 prize',NULL,'FIDE albums 1959-1961'),(98991,'',NULL,'82b4q1P1p2r1Pp2pB221k4BpSp3r3P2p3R3Ks','#3','','Siers battary in 4 variants and in the threat. Flight-giving key.\n1.Lb2! (2.Sa2+ Kd5 3.Sb4#), 1 - Lxb6 2.Sa4+ Kd5+ 3.Sxb6#, 1. - Dh4 2.Sb5+ Kd5 3.Sxc7#, 1. - Tg4 2.Se4+ Kd5 3.Sf6#, 1. - Th4 2.Sd1+ Kd5 3.Se3#.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','',NULL,'WCCT 1993-1996'),(98992,'',NULL,'1kSB2bs1B2Kp1r5p1rS1p1R1p1pppb43s41q1p48','#3','','Взаимная обструкция трех черных фигур на e5. 1.Ke8 ~ 2.Re7 Se5 3.Bc7x, 1...Sxe5 2.Be7 3.Bd6x, 1...Bxe5 2.Se7 3.Sec6x, 1...fe 2.Sd6 Ka7 3.Sac6x. Все варианты и угроза заканчиваются правильными матами.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','3 prize',NULL,'MT, 1961'),(98993,'',NULL,'4Q31111Sp11p11pk111p111111Kr1p4Bp7P','#4','','1.Lg5! Tb4 2.Zg8+ Kd5 4.Zf6+ Kd4 4.De3#, 1...c3 2.Dc8+ Ke5 3.Df5+ Kd4 4.Dd5#,\n1...f6 3.Le3! c3 3.Zc8+ Kd5 4.Zb6#,\nLauciņu bloķešana melno karalim, pareizi mati.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','',NULL,'PIRS 1956'),(98994,'',NULL,'3RRB26K1p9PS3p3kp3S1p3P4pP1s4Br1q1','#2','','Kf7! ~ 2.Lg7+ Kxc5 3.Tc8+ Kd6 4.Td8#,\n1...Df1+ 2.Zf4 Ke3 3.Td3+ Kf2 4.Zh3#,\n1...Tf1+ 2.Zf6+ Ke3 3.Zc2+ Kf2 4.Zxe4#.\nUz šahu balto karalim seko Zd5 precīza pretspēle.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','',NULL,'MK 1968 4 Godalga'),(98995,'',NULL,'6Q11bBpbB2R71rk1S3r2Rp3SpPp3q1K2p38','#2','','Одесская тема в трех фазах. 1.Dg1? ~ 2.Rd5, Rc4x, 1...e3 2.Sxd3x, 1...De3 2.Sxd7x, but 1...De6!, 1.Dc8? ~ 2.Bb6 Bd6x, 1...Bxc8 (Bxa6) 2.Rd5x, 1...Rxa6 2.Rc4x, but 1...Bc6!\n1.Dg5 ~ 2.Sxd3 Sxd7x, 1...Rb6 2.Bxb6x, 1...Bxg5 2.Bd6x. \nПервые фазы имеют различные опровержения. 1...d5, Bd5 2.Dxe7 Bxd5x.',0,'2009-10-24 16:13:48','2009-10-24 16:13:48',22,NULL,NULL,'','Special prize',NULL,'Večernaja Odessa, 1974'),(98996,'',NULL,'B6Kp3Q38S1Pp42Sk3pr6r2PP43RB3','#2','','Готова игра белой пешечной батареи 1...Rc3 2.dcx, 1...Re3 2.dex. В ложном следе 1.d3? ~ 2.Sc6x, 1...Rcxd3 2.c3x, 1...Rhxd3 2.De3x - самосвязывание черных ладей, но 1...dc! В решении черному королю предоставляются 2 поля:  1.Dd7! ~ 2.Dxd5x, 1...Kxc5 2.d4x, 1...Ke4 2.Dg4x. Радикальная перемена в трех фазах - меняются не только ходы черных и белых, но также и содержание тематических вариантов. Однако всю игру объединяют ходы одной белой пешки на четыре поля - тема Альбино',0,'2009-10-24 16:13:49','2009-10-24 16:13:49',22,NULL,NULL,'','Special prize',NULL,'Šahmaty, 1980'),(98997,'',NULL,'sBS4R1p1kpB21p1p2Pp1Pp4R2K53P1P21Q68','#2','','Игра во всех фазах этой двухходовки построена на цугцванге. В пробных играх 1.Bd5? e6 2.Dg7x, 1...e5! and 1.Dg7? e5 2.Bd5x, 1...e6! полная форма темы Владимирова в двух фазах. В решении игра и маты совершенно другие: 1.Dh2! e6 2.Dxd6x, 1...e5 2.Dh3x, 1...d5 2.Bxd5x',0,'2009-10-24 16:13:49','2009-10-24 16:13:49',22,NULL,NULL,'','',NULL,'Večerny Leningrad, 1984'),(98998,'',NULL,'3R41Bp2sb13s2Q18P1RpP2rS2kS31P64K1B1','#2','','Ложные следы (пробные игры): 1.Sg4? ~ 2.Rxd4x, 1...Sf5 2.Rc3x, but 1...c5! 1.Rb4? ~ 2.Rb3, 1...de 2.Ba6x, but 1...Sb5! Решение: 1.Ba6 ~ 2.Rc3x, 1...Sf5 2.Rcxd4, 1...de 2.Rb4x',0,'2009-10-24 16:13:49','2009-10-24 16:13:49',22,NULL,NULL,'','1-2 prize',NULL,'Tinerimya Moldovei, 1984'),(98999,'',NULL,'8pK1p1B221k2Sb2R3p1pP3p21Spr4r3s1sp','#5','','Neder 1.Ta5? ~ 2.Ta6#, jo 1...ab3! Jāizslēdz no spēles Zb3: 1.Tf5! (~ 2.Tf6#) Lg7 2.Zc5! (~ 3.Ze4#) Zg3! (2..Td4 draudu nenovērš) 3.Ze4+ Zxe4 un tikai tagad 4.Ta5! Zc5 5.bc5#. Mats gan cits nekā maldinājuma draudā.',0,'2009-10-24 16:13:49','2009-10-24 16:13:49',22,NULL,NULL,'','',NULL,'PSRS 1957'),(99000,'',NULL,'2S5811B1k1K11s3p1R5P22sp6b92b','#5','','1.Th7! ~ 2.Te7#. 1...Lc5 2.Tf7 Ze4 3.Txf5 Ld6 4.Te5+ Lxe5 5.f5#. Maza loģika palidz pieteikt skaistu pareizi matu.',0,'2009-10-24 16:13:49','2009-10-24 16:13:49',22,NULL,NULL,'','',NULL,'\"SCHACH\" 1970'),(99001,'',NULL,'1b3Sr14p2b7ss5pRR1q2kP1QpB2Pp11KpP2P12S1r3','#3','','A complicated problem in which are combined a Novotny threa, a Grimsshaw defence with unpin and selfpin with changes of W\'s 2nd and 3rd moves - a Pseudo le Grand combination with at the same time good s